import React, { Component } from 'react';

class PlaceItem extends Component {
  render () {
    return (
      <div className="place-item">
        {this.props.places.name} ({this.props.place.latitude}, {this.props.place.longitude})
      </div>
    )
  }
}

export default PlaceItem;
